$(document).ready(function(){$.getJSON("http://api.uwaterloo.ca/v2/foodservices/locations.json?key=f37a2830b2b3e202ce41630ba994ba0d",function(e){var t=e.data;t.sort(function(e,t){if(e.building<t.building){return-1}return 1});var n=true;$.each(t,function(e,t){if(t.is_open_now){n=false;$(".table").append("<tr><td>"+t.outlet_name+"</td><td>"+t.building+"</td></tr>")}});if(n){$(".table").after("<h2>Nothing is open LOL</h2>")}})})